import React from 'react'
import cl from './addBtn.module.scss'
import Input from '../Input/Input'

const AddBtn = () => {
  const classes = [cl.addBtn__btn].join(' ')

  console.log(classes)
  return (
    <div className={cl.addBtn__container}>
      <Input padding='6px' fontSize='14px' />
      <button
        type='button'
        className={cl.addBtn__btn}
        onClick={e => e.currentTarget.classList.add('invisible')}>
        add category
      </button>
    </div>
  )
}

export default AddBtn
